import React from 'react';

import './App.css';
import Display from './components/display';

class App extends React.Component{
  state={
    name : 'pal',
    age:'12',
    job:'div'
  }

  render(){
  return (
    <div className="App">
      <Display name={this.state.name} age={this.state.age} job={this.state.job}></Display>
      <Display></Display>
      <Display></Display>
      <Display></Display>
    </div>
  );
}
}

export default App;
